import App from './App';
import { Routes, Route } from 'react-router-dom';
import AdmindAsh from './Dash/Main';
import RegIster from './Register/Main';
import RegIon from './Register/Region/Main';
import RegIsterPhone from './Register/Phone/Main';
import RegIsterSign from './Register/SignIn/Main';
import RegIsterSignSuccess from './Register/RegisterSuccess/Main';
import SendPhone from './Send/Phone/Main';
import WithdrAwUSD from './Send/USD/Main';
import WithdrAwFC from './Send/FC/Main';
import SendUsd from './Send/Send/Main';
import Success from './Send/Success/Main';
import SuccessUSD from './Send/UsdSuccess/Main';
import BlocKSuCCess from './Send/BlockSuccess/Main';
import UseSend from './Send/Use/Main';
import UseSimple from './Send/UseSimple/Main';

import SendMoney from './Send/Main';
import BlockedSendMoney from './Send/Blocked/Main';
import AddMoney from './Add/Main';


// URI viewer component 
export default function ReturRnURI() {
 return (
  <Routes>

   <Route path='/dash' element={<AdmindAsh />} />
   <Route path='/dash/register' element={<RegIster />} />
   <Route path='/register/region' element={<RegIon />} />
   <Route path='/register/phone' element={<RegIsterPhone />} />
   <Route path='/register/signin' element={<RegIsterSign />} />
   <Route path='/register/success' element={<RegIsterSignSuccess />} />
   <Route path='/send/phone' element={<SendPhone />} />
   <Route path='/send/withdraw' element={<WithdrAwUSD />} />
   <Route path='/send/withdraw-fc' element={<WithdrAwFC />} />
   <Route path='/send-withdraw' element={<SendUsd />} />
   <Route path='/send/success' element={<Success />} />
   <Route path='/send/success-usd' element={<SuccessUSD />} />
   <Route path='/send/success-blocked' element={<BlocKSuCCess />} />
   <Route path='/send/use' element={<UseSend />} />
   <Route path='/send/use-simple' element={<UseSimple />} />
   <Route path='/send/withdraw-blocked' element={<BlockedSendMoney />} />
   <Route path='/dash/add' element={<AddMoney />} />

   <Route path='/' element={<App />} />
   <Route path='/send' element={<SendMoney />} />
   <Route path='*' element={<App />} />
  </Routes>
 );
};
